CREATE TABLE "audience" (
	"name"	TEXT,
	"minAge"	INTEGER,
	"maxAge"	INTEGER,
	PRIMARY KEY("name")
);

CREATE TABLE "city" (
	"cid"	INTEGER,
	"name"	TEXT,
	"country"	TEXT,
	PRIMARY KEY("cid")
);

CREATE TABLE "publishers" (
	"pid"	INTEGER,
	"name"	TEXT,
	"cid"	INTEGER,
	FOREIGN KEY("cid") REFERENCES "city"("cid"),
	PRIMARY KEY("pid")
);

CREATE TABLE "people" (
	"id"	INTEGER,
	"first"	TEXT,
	"last"	TEXT,
	"age"	INTEGER,
	"aid"	INTEGER UNIQUE,
	"cid"	INTEGER,
	PRIMARY KEY("id"),
	FOREIGN KEY("cid") REFERENCES "city"("cid")
);

CREATE TABLE "books" (
	"bid"	INTEGER,
	"title"	TEXT,
	"aid"	INTEGER,
	"pid"	INTEGER,
	"genre"	TEXT,
	"audience"	TEXT,
	PRIMARY KEY("bid"),
	FOREIGN KEY("audience") REFERENCES "audience"("name"),
	FOREIGN KEY("aid") REFERENCES "people"("aid"),
	FOREIGN KEY("pid") REFERENCES "publishers"("pid")
);

CREATE TABLE "store" (
	"id"	INTEGER,
	"name"	TEXT,
	"cid"	INTEGER,
	PRIMARY KEY("id"),
	FOREIGN KEY("cid") REFERENCES "city"("cid")
);

CREATE TABLE "read" (
	"bid"	INTEGER,
	"id"	INTEGER,
	PRIMARY KEY("bid","id"),
	FOREIGN KEY("id") REFERENCES "people"("id"),
	FOREIGN KEY("bid") REFERENCES "books"("bid")
);

CREATE TABLE "sells" (
	"sid"	INTEGER,
	"pid"	INTEGER,
	FOREIGN KEY("sid") REFERENCES "store"("id"),
	FOREIGN KEY("pid") REFERENCES "publishers"("pid"),
	PRIMARY KEY("sid","pid")
);


